import React from 'react';
import './ClassicalCheckboxesStyles.scss';

const ClassicalCkeckBoxes = () => {
	return(
		<div className="classical_checkbox_container">
		  <input id="composer_checkbox" type="checkbox" className='classical_checkboxes' />
		  <label for="composer_checkbox">This Composer</label>

		  <input id="worktype_checkbox" type="checkbox" className='classical_checkboxes' />
		  <label for="worktype_checkbox">Work Type</label>

		  <input id="c_genre_checkbox" type="checkbox" className='classical_checkboxes' />
		  <label for="c_genre_checkbox">Genre</label>
		</div>
	);
}

export default ClassicalCkeckBoxes;
